css:
@-moz-document url-prefix('http://twitter.com/') {

    div.trends-inner {

        display: none !important;

    }

    div.main-content{width:650px !important;}

    div.dashboard{min-width: 200px !important;}

    

    .tweet-box h2 {

        display:none !important;

    }



    .main-tweet-box {

        padding: 15px 0px 15px !important;

    }

    

    div.latest-favorite {

        width: 120px !important;

    }

    div.definition{

        display: none !important;

    }

    

    .tweet {

        padding: 10px !important;

    }

}
